import React from 'react'
import AppBar from '@mui/material/AppBar';
import { Typography } from '@mui/material';
import Link from '@mui/material/Link';


function SubHeader() {
  return (
    <AppBar color="default" position="relative">
        <Link href="#" variant="h6" underline="none" color="secondary" >Kids</Link>
        <Link href="#" variant="h6" underline="none" color="secondary" >Men</Link>
        <Link href="#" variant="h6" underline="none" color="secondary" >Women</Link>
        <Link href="#" variant="h6" underline="none" color="secondary" >Jewelery</Link>
        <Link href="#" variant="h6" underline="none" color="secondary" >Electronics</Link>

    </AppBar>
  )
}

export default SubHeader
